import {React, Fragment} from 'react'
import './DesignImageDesktopDesc.css'
function DesignImageDesktopDesc({ title }) {
    return (
        <Fragment>
            
        <div className='Desktop__Image__Design__Text'>
           <h1>{title} Design</h1>
            <p>View Projects</p>
           </div>
      
        </Fragment>
    )
}

export default DesignImageDesktopDesc
